import React, {useState} from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview, names, id}) {


	return (

		<View key={id} style={{
			height: 'auto',
	        justifyContent: 'center',
	        alignItems: 'center',
	        padding: 15,
	        backgroundColor: 'grey'
	      }}>
			<Image
          	source={{
            width: 200,
            height: 200,
            uri: preview
        }}
          />
          {names}		         
	</View>		
	)
}

export default KatsItem;
